window.bookSummaryJSON = "<p><b>The path to greatness is paved with valuable lessons, and this journey has proven that nothing is as it seems.</b></p> <p>Everyone at Heir Academy has a secret, friends and enemies alike, and it's up to me to navigate them all and get us out alive.</p> <p>Raiden, Kryll, Brody, Cassian… I'm not sure I would have survived this long without them, and it's about time I stop ignoring my heart.</p> <p>The problem is we walked right into their trap. But I'm not easy prey. I'm the rightful heir of Floodborn Kingdom, and I'll stop at nothing to prove I am worthy.</p> <p>Fortune may favor the bold, but fate favors the brave, and I plan to gather every ounce I possess to win my crown.</p>"; 
